import React from 'react';
import './App.css';

function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

function Login() {

  let title : string = "ft_transcendence";

  return (
    <div>
      <h1>{}</h1>
    </div>
  );
}

function Home() {

  return (
    <div>
      <h1>Home</h1>
    </div>
  );
}

function App() {

  let content;
  let isLogged : boolean = false;

  if (isLogged === false)
  {
    content = <Login/>
  }
  else
  {
    content = <Home/>
  }

  return (
    <div>
      {content}
    </div>
  );
}

export default App;
